values:
Last night I went to Japan, it was okay but I forgot my Japanese/English dictionary. Actually it was pretty fun and all I did was drink other peoples alcohol which is apparently my forte and also Sara mixes weak drinks. Thank god I have such a convenient flask.&nbsp;

Today I woke up, watched Dani and Sara eat giant wraps at Montana's and drove around a lot. I'm so hungry now and also really wish I was laying down in the sun but Katie's parents are here and I dont want to go downstairs and see them. Ughhh. Ok but I think I have to!!!!

I am so bored. I guess I could study but I know I won't. K whateva. I go home for good in a week. JEALOUS?

Okay I'm addicted to talking about my life. But I guess it's okay, I'm just sitting here at 1:30 in the morning trying not to puke and wishing I could fall asleep. I tried to do homework but gave up as soon as I realised I'd have to go upstairs to get a pencil. I'm dropping out of art school, who am I kidding? I can't fit coffee in my portfolio and I just don't care enough about things to try and dress other people.

I am having problems eating lately and while I always have eating problems these ones involve near puking almost every time I think about food and it's just not fun. Also the other day I realised that I drink most of my calories. Which is I guess okay because if I didn't I don't think I would get as many as I should. I don't just mean alcohol drink, I just mean I'm a sucker for the drinking isn't fattening mindset. Not really, I guess I don't know what I'm talking about.

Other than wanting to puke and wanting to sleep and wishing I had no homework I just am pretty happy about life. I'm happy to have Leah and Marcella in my life, I'm happy that they have people in their lives that make them happy, I'm happy my family is so funny and that in 20 days I'm done my first year of college! I'm nervous though, that in a year and 20 days I'm basically expected to be an adult, no more transitions. No more parents-pay-rent and no more parents-bail-me-out. It's good though, I'm kind of excited. Yeah. I hope it all works out okay, I don't know why it wouldn't. I wish I tried harder in school this semester but I just could not. Instead I laid in bed thinking about how much I hate school and hate Lethbridge and don't know why I would pursue something so ridiculous. Now I'm laying in bed thinking about how much I should love school and sometimes do when I get to do okay things and how I guess Lethbridge could really be&nbsp;a&nbsp;lot worse and how I am pursuing this because I want to do something I like instead of just standing around scanning things and turning into Lori Sardy.&nbsp;

God, tooooo deep. I really am in art school. Today/tomorrow I have to go back to Lethbridge for what is basically the last time in four months. And then it is summer when all I will do is work and sleep and hang out with good people and also even maybe okay people. Also I'm gonna try not to feel like this and I'm gonna tell people about all the things I know but never remember. My lips are chapped and my hair is dirty but I won't do anything about either of them for probably a while.&nbsp;

I'm quitting slurpees they keep me up forever and it just seems like sleeping is a lot more productive than refreshing the internet hoping something cool will happen. The internet isn't really that cool. Neither am I and neither is dirty laundry.&nbsp;

Cool as a cucumber.
